import React from 'react'

export const Pagination = ({limit, onClick}) => {
  return (
    <div>
        {limit === 20 ? null :<button onClick={onClick}>Back</button>}

        <p>1</p>

        {limit === 140 ? null :<button onClick={onClick}>Next</button> }
    </div>
  )
}
